const url = 'http://10.210.20.33:18080'

const urls = class {
    static m() {
        const login = `${url}/api/v1/login`
        const userlist = `${url}/api/v1/user/list`
        const userdelete = `${url}/api/v1/user/delete`

        return {
            login,
            userlist,
            userdelete
        }
    }
}
export default urls
